import {BrowserRouter as Router, Switch, Route, Link} from "react-router-dom";
import {Image} from "./components/Image/image";
import {Kitchen} from "./Kitchen";
import {Industry} from "./Industry";
import {ShoppingList} from "./ShoppingList";

const App= ()=> {
  return (
      <Router>
          <div className="main_container">
    <div className="App">
        <Image/>
        <h1>Mój Dom</h1>
    </div>
      <div className="buttons">
          <Link to="/Kitchen" className="btn">Stan Kuchni</Link>
          <Link to="/Industry" className="btn">Stan Przemysłu</Link>
          <Link to="/ShoppingList" className="btn">Lista Zakupów</Link>
          <button className="btn">Pogoda</button>
          <Switch>
              <Route path = "/Kitchen"><Kitchen/></Route>
          </Switch>
          <Switch>
              <Route path = "/Industry"><Industry/></Route>
          </Switch>
          <Switch>
              <Route path = "/ShoppingList"><ShoppingList/></Route>
          </Switch>
      </div>
          </div>

      </Router> );
}

export default App;
